    "                    if(!doneN) posN.x -= offNP.x * FXAA_QUALITY_P5;",
    "                    if(!doneN) posN.y -= offNP.y * FXAA_QUALITY_P5;",
    "                    doneNP = (!doneN) || (!doneP);",
    "                    if(!doneP) posP.x += offNP.x * FXAA_QUALITY_P5;",
    "                    if(!doneP) posP.y += offNP.y * FXAA_QUALITY_P5;",
    "/*--------------------------------------------------------------------------*/",
